        // Funktion zum Hinzufügen der Legende
        function addLegend() {
            var legend = L.control({position: 'bottomright'});
            legend.onAdd = function (map) {
                var div = L.DomUtil.create('div', 'info legend');
                div.innerHTML =
                    '<h4>Suitability Score</h4>' +
                    '<ul>' +
                    '<li><span style=\"background:#440154\"></span>1.00, 1.80</li>' + '<li><span style=\"background:#3b528b\"></span>1.80, 2.60</li>' + '<li><span style=\"background:#21918c\"></span>2.60, 3.20</li>' + '<li><span style=\"background:#5ec962\"></span>3.20, 3.60</li>' + '<li><span style=\"background:#fde725\"></span>3.60, 4.00</li>' + 
                    '</ul>';
                L.DomEvent.disableClickPropagation(div);
                L.DomEvent.disableScrollPropagation(div);

                // Einklappfunktion hinzufügen
                var titleElement = div.querySelector('h4');
                var listElement = div.querySelector('ul');
                titleElement.addEventListener('click', function() {
                    div.classList.toggle('legend-collapsed');
                    if (div.classList.contains('legend-collapsed')) {
                        listElement.style.display = 'none';
                    } else {
                        listElement.style.display = 'block';
                    }
                });

                return div;
            };
            legend.addTo(map_f853eba95a84abcea9f8c195652bd342);
            
            // Draggable-Funktionalität hinzufügen
            $('.legend').draggable({
                containment: '#map_f853eba95a84abcea9f8c195652bd342',
                start: function(event, ui) {
                    $(this).css({
                        right: 'auto',
                        bottom: 'auto',
                        position: 'absolute'
                    });
                }
            });
        }

        // Sicherstellen, dass die Karte geladen ist
        if (typeof map_f853eba95a84abcea9f8c195652bd342 !== 'undefined') {
            addLegend();
        } else {
            setTimeout(addLegend, 500);
        }
    });
    </script>
